import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import ListComponent from "./project4/CitiesList";
import ResultComponent from "./project4/Result";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={ListComponent} />
        <Route path="/result" component={ResultComponent} />
      </Switch>
    </Router>
  );
};

export default App;
